INSERT INTO `event` VALUES (212,'theatre','اوقات سگی',1.00,100000,NULL,9,NULL,'استاد دانشگاهی که به خاطر مسائلی از دانشگاه اخراج و خانه نشین شده است، در روز تولدش زنی ناشناس را در خانه خود میبیند','از همراه داشتن فرزندان زیر ۱۸ سال خودداری نمایید.'),(213,'theatre','کروکودیل',0.80,100000,NULL,9,NULL,'گذشته رو نمی‌شه تغییر داد، ولی هنوز زمان داریم آینده رو اونطوری که می‌خوایم عوضش کنیم.',NULL),(214,'theatre','کشتن گربه بابا فونتن',0.75,100000,20,9,NULL,'کشتن گربه بابا فونتن، برش کوتاهی از زندگی پسر نوجوانی به نام نعیم است که در دوران پس از انقلاب الجزایر در یک آسایشگاه روانی روایت میشود. نعیم در بحبوحه انقلاب، مونیک، دختری فرانسوی که در واقع عاشق او بوده است را تنها به جرم فرانسوی بودنش میکشد و در طول نمایشنامه در مواجهه با پرسشگر دائما در حال کتمان این مسئله است.',' از همراه داشتن فرزندان زیر ۱۵ سال خودداری نمایید.'),(215,'theatre','سینما کارون',1.00,80000,NULL,9,NULL,'من سینما کارونم.','از همراه داشتن فرزندان زیر 10 سال خودداری نمایید.'),(216,'theatre','خبرنگار بی خبر',0.50,60000,NULL,9,NULL,'فرد دست‌فروشی وارد کافه میشود و مسئول کافه برای خارج کردن او با چالشی روبه‌رو میشود.',NULL),(217,'theatre','اسکرین شات',1.20,200000,15,9,NULL,'از یک دوره همی شبانه تا نابودی چند خانواده','از همراه داشتن فرزندان زیر 12 سال خودداری نمایید.'),(218,'theatre','دامبوبو',0.75,60000,50,9,'توجه: شماره تماس از سوی گروه محترم اجرایی درج شده است و تیوال نقشی در عملکرد و پاسخدهی آن ندارد.','داستان درباره پسری ساده و خوش قلب به نام دامبوبو است که در مسیر بازگشت به خانه با اتفاقات و شخصیت های مختلفی روبرو میشود و...','از همراه داشتن فرزندان زیر 2 سال خودداری نمایید.'),(219,'concert','ساز و سرود',1.50,320000,NULL,9,NULL,NULL,NULL),(220,'concert','تکنوازی سه‌تار محمد صمدی',1.00,150000,NULL,9,'ترتیب گوشه‌ها و نغمات:\nبخش اول:\nگوشه اول: درآمد\nقطعه: بیات اصفهان استاد لطفی\nگوشه دوم: جامه‌دران\nقطعه: هی داد هی بیداد\nبخش دوم:\nاول: بداهه‌نوازی در بیات اصفهان\nدوم: قطعه‌ی ئامان هی ئامان','تکنوازی سه‌تار در آواز بیات اصفهان',' از همراه داشتن فرزندان زیر ۱۵ سال خودداری نمایید'),(221,'theatre_film','زنان بالکان',0.75,35000,NULL,9,'مناسب برای مخاطبان بالای ۱۰ سال','داستان نمایش در بحبوبه جنگ بین صربستان و بوسنی و در زندانی که صرب ها زنان اسیر شده بوسنیایی را در آنجا نگهداری می کنند اتفاق می افتد.',NULL),(222,'theatre_film','هر کسی یا روز می‌میرد یا شب من شبانه روز',0.50,14000,NULL,9,NULL,'هرکسی یا روز می میرد یا شب، من شبانه روز قصه این روزهای تمام ماست، تمام آن ها که در این خانه مانده اند و تمام آن ها که از این خانه رفته اند و تمام آن ها که به این خانه باز می گردند و ما تمام تلاشمان را می کنیم تا آن ها که دوستشان می داریم یک ثانیه هم که شده بیشتر روی پاهایشان بایستند، شبیه آواز غمگینی که از تو دعوت می کند تا پای جان با زندگیت برقصی.',NULL),(223,'series','گیسو',0.45,14000,NULL,NULL,NULL,'رضا در مخمصه‌ای افتاده که برای بیرون آمدن از آن به کمک سهیل و پیمان نیاز دارد. اما نقشه آن‌ها آن‌طور که باید پیش نمی‌رود و اتفاقاتی رخ می‌دهد که کنترل اوضاع را از دست همه خارج می‌کند و ...',NULL),(224,'series','آفتاب پرست',1.00,15000,NULL,NULL,NULL,'جمال و منوچ که عشق لاتی و سطح یک شدن در خفت‌گیری را دارند از بی عرضه‌گی و بدشانسی گیر پلیس می‌افتند و به زندان می‌روند. جمال در زندان به همه می‌گوید که در سطح یک فقط پورشه‌سوار خفت کرده‌اند و به همین خاطر به جمال پورشه معروف می‌شود و...',NULL),(225,'workshop','انیمیشن فیلشاه، مدل‌سازی',NULL,199000,NULL,NULL,'شما با خرید این مجموعه می‌توانید علاوه بر استفاده از ۴ دوره ضبط شده کارگردانی، تدوین، نورپردازی و کامپوزیت و مدلسازی و تکسچر در کلاس آنلاینی که با حضور هادی محمدیان، کارگردان انیمیشن «فیلشاه» جهت پرسش و پاسخ و رفع اشکال در تاریخ اوایل خرداد‌ماه برگزار می‌گردد، حضور یابید.','کارگاه انیمیشن سینمایی فیلشاه با تدریس هادی محمدیان، حسن ایوبی، علی دین‌جو و مهدی عبداللهی از گروه هنرپویا در زمینه‌های کارگردانی، تدوین، نورپردازی، کامپوزیت، مدلسازی و تکسچر در انیمیشن سه بعدی برگزار شده است.',NULL),(226,'course','حقوق برای همه',NULL,2400000,NULL,9,'«حقوق برای همه» عنوان دوره‌ای از درس‌گفتارهای حقوقی است که دانش حقوق را برای استفاده‌ی عموم گویاسازی کرده است.\nایشان در همین ترم، درس‌گفتار \"فلسفه‌ی حقوق\" را در ساعت 19 تا 21 ارائه کرده‌اند که این کلاس نیز از 29 بهمن آغاز می‌شود','۱۰ جلسه درس‌گفتار حضوری با دکتر محسن برهانی.',NULL),(227,'game','مافیا | دن کلاب مشهد (آبکوه)',1.50,40000,NULL,9,NULL,NULL,NULL),(228,'Entertainment','ضیافت قابیل',NULL,100000,NULL,9,NULL,'در یک عمارت بزرگ چهار مرد و دو زن به ضیافت شامی دعوت شده اند، با شنیدن صدای ناقوس متوجه میشوند برای نجات جان خود باید...','از همراه داشتن فرزندان زیر ۱۲ سال خودداری نمایید'),(229,'Exhibit','دومین دوره آرت فیر تهران',NULL,70000,10,NULL,'ین نمایشگاه از ساعت ۱۵:۰۰ تا ۲۱:۰۰ در مرکز همایشهای رایزن برگزار می‌شود.\nبزرگترین نمایشگاه هنر درایران در دوره ی قبلی میزبان بیش از ۵ هزار هنرمند و هنردوست بود.\nاین رویداد هرساله با برگزاری گروه هنری نگارا به سرانجام میرسد.',NULL,NULL),(230,'radio_theatre',NULL,NULL,100000,NULL,NULL,NULL,NULL,NULL);
